import React from "react";
import ReactDOM from "react-dom";
import PaasCalculator from "./components/PaasCalculator";
import EnterPassword from "./components/PaasCalculator";

const Index = ({ password }) => {
  const isLoggedIn = password.isLoggedIn;
  if (isLoggedIn) {
    return <PaasCalculator />;
  }
  return <EnterPassword />;
};

ReactDOM.render(<PaasCalculator />, document.getElementById("paas-calculator"));
